// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract BalanceViewer {

    // Address of the token contract you want to query
    address public tokenContract;

    constructor(address _tokenContract) {
        tokenContract = _tokenContract;
    }

    function balanceOf(address owner) external returns (uint256) {
        // Directly call the balanceOf function of the token contract
        (bool success, bytes memory data) = tokenContract.call(abi.encodeWithSignature("balanceOf(address)", owner));
        require(success, "Token balanceOf call failed");
        return abi.decode(data, (uint256));
    }
}
